import React, { Component } from 'react'

export class New extends Component {

    constructor() {
      super()
    
      this.state = {
        news : []
      }
    }

     componentDidMount(){

        const options = {
            method: 'GET',
            headers: {
                'X-RapidAPI-Key': 'f147bb7b8eed4babbb42c29ebcc501b5',
                'X-RapidAPI-Host': 'locale-news.p.rapidapi.com'
            }
        };
        
        fetch('https://locale-news.p.rapidapi.com/news?region=DE&lang=de', options)
            .then(response => response.json())
            .then(response => console.log(response))
            .catch(err => console.error(err));
     }

  render() {
    return (
      <div>New</div>
    )
  }
}

export default New
